import Chart from './chart'
import InvalidGrammarError from '../error/invalid-grammar-error'

export default class AreaChart extends Chart {

	constructor(data) {
		super(data)
	}

	do(grammar) {
		if (grammar.match(new RegExp('where [0-9a-zA-Z\\-]+ as area-spline'))) {
			let areaSplineDataLabel = grammar.match(new RegExp('where [0-9a-zA-Z\\-]+ as area-spline'))[0].split(' ')[1]
			this._outputJson.data.types[areaSplineDataLabel] = 'area-spline'
		} else if (grammar.match(new RegExp('where [0-9a-zA-Z\\-]+ as area'))) {
			let areaDataLabel = grammar.match(new RegExp('where [0-9a-zA-Z\\-]+ as area'))[0].split(' ')[1]
			this._outputJson.data.types[areaDataLabel] = 'area'
		} else {
			throw new InvalidGrammarError()
		}
	}
}

import Chart from './chart'
import InvalidGrammarError from '../error/invalid-grammar-error'

export default class BarChart extends Chart {

	constructor(data) {
		super(data)

		// Set to bar chart
		this._outputJson.data.type = 'bar'
	}

	do(grammar) {
		if (grammar.match(new RegExp('set bar width as \\d+(\\.\\d+)*( pixels)?'))) {
			let widthValue = grammar.match(new RegExp('set bar width as \\d+(\\.\\d+)*'))[0].split(' ')[4]
			if (grammar.match(new RegExp('pixels'))) {
				let barWidthPixels = Number(widthValue)
				this._outputJson['bar'] = {
					'width': barWidthPixels
				}
			} else {
				let barWidthRatio = Number(widthValue)
				this._outputJson['bar'] = {
					'width': {
						'ratio': barWidthRatio
					}
				}
			}
		} else {
			throw new InvalidGrammarError()
		}
	}
}

import InvalidOperationError from '../error/invalid-operation-error'

export default class Chart {

	constructor(data) {
		this._data = data

		// Define output JSON
		this._outputJson = {
			'data': {
				'x': undefined,
				'xs': {},
				'columns': [],
				'types': {},
				'groups': [],
				'type': undefined
			},
			'bar': {
				'width': {
					'ratio': undefined
				}
			},
			'donut': {
				'title': undefined
			}
		}

		// Add _data
		let dataJson = JSON.parse(this._data)
		for (let i in dataJson) {
			this._outputJson.data.columns.push([i, ...dataJson[i]])
		}
	}

	// eslint-disable-next-line no-unused-vars
	do(grammar) {
		throw new InvalidOperationError()
	}

	generateJson() {
		return this._outputJson
	}
}

